import React from 'react'
import { repo } from '../../data'

function ReposDiv() {
  return (
    <div>
      <div className="link">
        <a href={repo.html_url} target='blank'>{repo.name}</a>
        <span className="visibility"></span>
      </div>
    </div>
  )
}

export default ReposDiv
